import React from 'react';
import Post from './post/post';
import Profile from './profile/profile';
import AddPostContainer from "./addPost/addPost-container";

const Content = (props) => {
    debugger;
    let dialogsPost = props.store.state.profilePage.postData.map(post => <Post message={post.message} like={post.like}/>);
    return (
        <div>
            <Profile/>
            <AddPostContainer store={props}/>
            {dialogsPost}
        </div>
    );
}
export default Content;
